import React, { useState } from 'react'
import Header from './Header'
import "./Register.css";
import Axios from 'axios'

export default function Register() {
  const [newname, setNewname] = useState('');
  const [newsurname, setNewsurname] = useState('');
  const [newage, setNewage] = useState('');
  const [newuser, setNewuser] = useState('');
  const [newpass, setNewpass] = useState('');

  const register = () => {

    Axios.post('http://localhost3000/register', {
      name: newname,
      surname: newsurname,
      age: newage,
      username: newuser,
      password: newpass,
    }).then((response) => {
      console.log(response);
    });
  };


  return (<Header title='Register'>
    <form className="register-form">
      <div className="home">
        <div className="inputs">

          <h3>Name:</h3>
          <input type="text" onChange={(e) => { setNewname(e.target.value) }} name="name" />

          <h3>Surname:</h3>
          <input type="text" onChange={(e) => { setNewsurname(e.target.value) }} name="surname" />

          <h3>Age:</h3>
          <input type="date" onChange={(e) => { setNewage(e.target.value) }} name="age" />

          <h3>Email:</h3>
          <input type="email" onChange={(e) => { setNewuser(e.target.value) }} name="username" />

          <h3>Password:</h3>
          <input type="password" onChange={(e) => { setNewpass(e.target.value) }} name="password" />

          <div className="d-flex justify-between">
            <button onClick={ (register()) } className="button">Register</button>
            <button>Login</button>
          </div>
        </div>
      </div>
    </form>
  </Header>
  )
}
